traTitle\":\"Problem\"},\"subContentId\":\"0f850890-b69f-4130-978e-fefe35558374\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>The divisors of 80 are: 1, 2, 4, 5, 8, 10, 16, 20, 40, 80</p>\\n\\n<p>Therefore, the 80 pieces of Lego can be grouped as follows:</p>\\n\\n<ul>\\n\\t<li>1 group containing 80 pieces.</li>\\n\\t<li>2 groups containing 40 pieces each.</li>\\n\\t<li>4 groups containing 20 pieces each.</li>\\n\\t<li>5 groups containing 16 pieces each.</li>\\n\\t<li>8 groups containing 10 pieces each.</li>\\n\\t<li>10 groups containing 8 pieces each.</li>\\n\\t<li>16 groups containing 5 pieces each.</li>\\n\\t<li>20 groups containing 4 pieces each.</li>\\n\\t<li>40 groups containing 2 pieces each.</li>\\n\\t<li>80 groups containing 1 piece each.</li>\\n</ul>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"81beb219-b4d5-465c-8d23-77d0898e45b5\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Solution\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Solution\"},\"subContentId\":\"695d6027-7702-4314-98c2-6b76fce5a273\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Problem 1: Lego\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem 1: Lego\"},\"subContentId\":\"a48c1e5d-a366-4c20-90b3-f9900ba15c7e\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p><strong>Problem 2: Apples</strong></p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"7fe9e674-8ad3-4805-8a4a-22e2add0d51f\"},\"useSeparator\":\ I7AggggAACCCCAAAJjRCBzg8BuFOyP7LPSOruVSCcyI68IVGpa1SwrpVObCcITiB8jE8owEUAAAQQQQAABBEpOgIB8yU0pF4QAAggggAACCCCAAAIIIIAAAggggAACCCBQjAIE5ItxVhgTAggggAACCCCAAAIIIIAAAggggAACCCCAQMkJEJAvuSnlghBAAAEEEEAAAQQQQAABBBBAAAEEEEAAAQSKUYCAfDHOCmNCAAEEEEAAAQQQQAABBBBAAAEEEEAAAQQQKDkBAvIlN6VcEAIIIIAAAggggAACCCCAAAIIIIAAAggggEAxChCQL8ZZYUwIIIAAAggggAACCCCAAAIIIIAAAggggAACJSdAQL7kppQLQgABBBBAAAEEEEAAAQQQQAABBBBAAAEEEChGAQLyxTgrjAkBBBBAAAEEEEAAAQQQQAABBBBAAAEEEECg5AQIyJfclHJBCCCAAAIIIIAAAggggAACCCCAAAIIIIAAAsUoQEC+GGeFMSGAAAIIIIAAAggggAACCCCAAAIIIIAAAgiUnMD/AQyVJFNy+Q/GAAAAAElFTkSuQmCC\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":1508,\"height\":422},\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"319c4956-5df8-463f-b5f7-74c47dbd9a16\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>1. A farmer picks 72 red apples and 81 green apples. He wants to divide and place them in bags such that all the apples in the same bag have the same color and all the bags have the same number of apples. How many apples will there be in each bag such that this number is between 2 and 8?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"4cc64549-908a-4fe3-8374-3ed0eb166a27\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2. Knowing the number of apples in each bag, how many bags will contain red apples only and how many bags will contain green apples only?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"8208c4c5-43a3-4a49-9c8b-ada28d830665\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"76a77e02-5c32-41c8-909e-06ea1d843057\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. The divisors of 72 are: 1, 3, 4, 6, 8, 9, 12, 18, 24, 72<br />\\nThe divisors of 81 are: 1, 3, 9, 27, 81<br />\\nThe common divisors of 72 and 81 are: 1, 3, and 9 but since the number of apples has to be between 2 and 8, then, the farmer will place each 3 apples in a bag.</p>\\n\\n<p> </p>\\n\\n<p>2.</p>\\n\\n<p>72 ÷ 3 = 9<br />\\n81 ÷ 3 = 27<br />\\n9 bags will contain red apples only and 27 bags will contain green apples only.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9454aca6-73a6-4856-b9f2-384436efbcc0\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Solution\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Solution\"},\"subContentId\":\"e37bff86-3df5-42dd-879d-404e3a84df67\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Problem 2: Apples!\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem 2: Apples!\"},\"subContentId\":\"935f5524-4f19-4a77-836d-471a0ac157e4\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Problem 3: Organizing Tea Bags</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c0b2f976-3d05-4ee4-be76-d8cadccf550f\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"Documentation tool\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>Mrs. Murad is an event planner. She is currently in charge of organizing a tea party to raise funding for homeless people.</p>\\n\\n<p>Mrs. Murad wants to organize the tea bags in trays such that all the trays would be identical.</p>\\n\\n<p>There are 88 bags of green tea, and 96 bags of black tea.</p>\\n\\n<p>1. What is the greatest number of trays she needs?</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8c409734-04bd-423f-9abb-584c8536fd02\"},{\"params\":{\"inputFieldSize\":\"10\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"529db8a9-f49b-4ca1-91c8-9786936cc7f5\"},{\"params\":{\"text\":\"<p>2. Considering the greatest number of trays she needs, how many bags of each tea flavor will each tray contain?</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"6d1cd39a-fb74-4788-ae73-20958ffa53a8\"},{\"params\":{\"inputFieldSize\":\"10\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"81f515ed-1f01-4ead-acfa-e23394fde9bc\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"9bf1d74a-9992-4daa-80ce-29c3450d8bbc\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. Divisors of 88: 1, 2, 4, 8, 11, 22, 44, and 88.<br />\\nDivisors of 96: 1, 2, 3, 4, 6, 8, 12, 16, 24, 32, 48, and 96.<br />\\nThe common divisors of 88, and 96 are 1, 2, 4, and 8.<br />\\nGCD (88; 96) = 8<br />\\nThe greatest number of trays she needs is 8.</p>\\n\\n<p> </p>\\n\\n<p>2. Considering that there will be 8 identical trays.<br />\\n88 ÷ 8 = 11<br />\\n96 ÷ 8 = 12<br />\\nEach tray will contain 11 bags of green tea, and 12 bags of black tea.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"dee29287-170b-4490-8366-7ded38c4185b\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Solution\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Solution\"},\"subContentId\":\"6cdfb189-ae3f-4b1b-b480-0c15942cb3a9\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"06bec21a-3ecc-488f-9871-c4a16c05838d\"},\"useSeparator\":\"disabled\"}]}","library":"H5P.Column 1.15","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"Complex Problems","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.AdvancedText-1.1/text.js?version=1.1.14","/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.TextInputField-1.2/text-input-field.js?version=1.2.13","/h5p/libraries/H5P.TextInputField-1.2
